    public static class StiBingMapHelper
    {
        #region Constants
        public static string BingMapKey;

        public static string BingKeysUrl = "https://www.stimulsoft.com/bing/map-keys.php";

        private static readonly string DefaultBingKey = "As5HUjWYztVI3tJdw5MMHau9DGYHWrtaEt3FztAV4N7RAMbB0Xl3CV7c4vDW7Ly5";

        private static readonly string Script = "";

        private static string _bingKey;
        #endregion

        #region Methods
        private static string BingKey
        {
            get
            {
                if (!string.IsNullOrEmpty(BingMapKey))
                {
                    return BingMapKey;
                }
                else if (!string.IsNullOrEmpty(_bingKey))
                {
                    return _bingKey;
                }
                else
                {
                    var keys = string.Empty;
                    try
                    {
                        ServicePointManager.SecurityProtocol = SecurityProtocolType.Tls12;
                        var webClient = new WebClient
                        {
                            Proxy = StiProxy.GetProxy()
                        };
                        webClient.Headers.Add("Accept: text/html, application/xhtml+xml, */*");
                        webClient.Headers.Add("User-Agent: Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0)");

                        try
                        {
                            keys = webClient.DownloadString(BingKeysUrl);
                        }
                        catch { }
                        finally
                        {
                            webClient.Dispose();
                        }

                        var bingKeys = new List<string>();

                        if (!string.IsNullOrEmpty(keys))
                        {
                            var bingKeysToken = JsonConvert.DeserializeObject(StiEncryption.Decrypt(keys, "KJH98kjJK1!!")) as JToken;
                            var keysToken = bingKeysToken?["keys"] as JArray;
                            bingKeys.AddRange(keysToken.ToObject<string[]>());
                        }
                        bingKeys.Add(DefaultBingKey);

                        foreach (var key in bingKeys)
                        {
                            try
                            {
                                var url = $"http://dev.virtualearth.net/REST/v1/Imagery/Map/Road/47.645523,-122.139059/18?key={key}";

                                ServicePointManager.SecurityProtocol = SecurityProtocolType.Tls | SecurityProtocolType.Tls11 | SecurityProtocolType.Tls12;

                                var request = WebRequest.Create(url);
                                request.Method = "GET";
                                var response = request.GetResponse();
                                var dataStream = response.GetResponseStream();
                                var image = new Bitmap(dataStream);
                                dataStream.Close();
                                response.Close();
                                image.Dispose();
                                _bingKey = key;
                                return _bingKey;
                            }
                            catch { }
                        }
                    }
                    catch { }

                    _bingKey = DefaultBingKey;
                    return _bingKey;
                }                
            }            
        }

        public static Bitmap GetImage(Size size, List<string> pushPins = null)
        {
            #region Check Min Width and Height
            if (size.Width < 50)
                size = new Size(50, size.Height);

            if (size.Height < 50)
                size = new Size(size.Width, 50);
            #endregion

            var url = GetBingUrl(size);

            ServicePointManager.SecurityProtocol = SecurityProtocolType.Tls | SecurityProtocolType.Tls11 | SecurityProtocolType.Tls12;

            var request = WebRequest.Create(url);
            request.Method = "POST";
            var postData = new StringBuilder();

            var count = pushPins.Count;
            if (count > 100)
                count = 100;

            if (pushPins.Count > 0)
            {
                for (var i = 0; i < count; i++)
                {
                    postData.Append(pushPins[i] + (i != count - 1 ? "&" : ""));
                }
            }

            var byteArray = Encoding.UTF8.GetBytes(postData.ToString());
            request.ContentType = "text/plain; charset=utf-8";
            request.ContentLength = byteArray.Length;

            var dataStream = request.GetRequestStream();
            dataStream.Write(byteArray, 0, byteArray.Length);
            dataStream.Close();

            var response = request.GetResponse();
            dataStream = response.GetResponseStream();
            var image = new Bitmap(dataStream);
            dataStream.Close();
            response.Close();
            return image;
        }

        private static string GetBingUrl(Size size)
        {
            return $"https://dev.virtualearth.net/REST/v1/Imagery/Map/CanvasLight/?mapSize={size.Width},{size.Height}&key={BingKey}";
        }

        public static byte[] GetImage(IStiAppComponent element, Size size, Hashtable mapData, string elementKey, bool ignoreSize = false)
        {
            var key = GetCacheKey(mapData, size.GetHashCode());

            #region Check Min Width and Height
            if (size.Width < 300 || size.Height < 300)
            {
                var cx = Math.Max(300d / size.Width, 300d / size.Height);
                size = new Size((int)(size.Width * cx), (int)(size.Height * cx));
            }
            #endregion

            var webBrowser = StiOnlineMapRepaintHelper.Get(element, key, ignoreSize);
            if (webBrowser == null)
                webBrowser = StiOnlineMapRepaintHelper.Add(element, key, GetScript(mapData), size, elementKey);

            webBrowser.DocumentText = GetScript(mapData);

            if (ignoreSize)
                webBrowser.Size = size;

            using (var image = new Bitmap(size.Width, size.Height))
            {
                webBrowser.DrawToBitmap(image, new Rectangle(0, 0, size.Width, size.Height));
                using (var stream = new MemoryStream())
                {
                    image.Save(stream, ImageFormat.Png);
                    return stream.ToArray();
                }
            }
        }

        public static void DrawImage(IStiAppComponent element, Size size, Hashtable mapData, Graphics g, RectangleD location, string elementKey, int uniqueCode, bool ignoreSize = false, bool isExporting = false)
        {
            var origialSize = size;

            #region Check Min Width and Height
            if (size.Width < 300 || size.Height < 300)
            {
                var cx = Math.Max(300d / size.Width, 300d / size.Height);
                size = new Size((int)(size.Width * cx), (int)(size.Height * cx));
            }
            #endregion

            if (!isExporting)
            {
#if !BLAZOR
                var webBrowser = StiOnlineMapRepaintHelper.Get(element, uniqueCode, ignoreSize);
                if (webBrowser == null)
                    webBrowser = StiOnlineMapRepaintHelper.Add(element, uniqueCode, GetScript(mapData), size, elementKey);

                if (ignoreSize)
                    webBrowser.Size = size;

                if (webBrowser.ReadyState == WebBrowserReadyState.Complete)
                {
                    using (var image = new Bitmap(size.Width, size.Height))
                    {
                        webBrowser.DrawToBitmap(image, new Rectangle(0, 0, size.Width, size.Height));
                        if (size.Equals(origialSize) && !ignoreSize)
                            g.DrawImageUnscaled(image, location.ToRectangle());
                        else
                            g.DrawImage(image, location.ToRectangle());
                    }
                }
#endif
            }
            else
            {
                StiOnlineMapRepaintHelper.ExportImage(g, GetScript(mapData), size, origialSize, location);
            }
        }

        public static string GetScript(Hashtable mapData)
        {
            var script = new StringBuilder(StiGZipHelper.Unpack(Script));
            if (mapData["locations"] != null)
            {
                var dataSer = JsonConvert.SerializeObject(mapData["locations"], Formatting.None, new StringEnumConverter());
                script.Replace("_DATA_", dataSer);
                var locationType = mapData["locationType"].ToString();
                if (locationType != "Auto") script.Replace("_entityType_", locationType);
                else script.Replace("entityType: '_entityType_',", "");
            }
            else if (mapData["pushpins"] != null)
            {
                var dataSer = JsonConvert.SerializeObject(mapData["pushpins"], Formatting.None, new StringEnumConverter());
                script.Replace("_DATA_", dataSer);
                script.Replace("document.mapType = 'locations';", "document.mapType = 'pushpins';");
            }
            else
            {
                script.Replace("_DATA_", "[]");
                script.Replace("entityType: '_entityType_',", "");
            }
            script.Replace("_KEY_", BingKey);
            script.Replace("_THEME_", mapData["theme"].ToString());
            script.Replace("_LANGUAGE_", mapData["culture"].ToString());
            script.Replace("_BACKGROUND_COLOR_", "\"" + mapData["backgroundColor"].ToString() + "\"");
            script.Replace("_BACKGROUND_COLOR2_", mapData["backgroundColor"].ToString());

            if (mapData["outerStyle"] != null)
            {
                script.Replace("display: table;", mapData["outerStyle"].ToString());
            }

            if (mapData["title"] != null)
            {
                script.Replace("display:none'></div>", mapData["title"].ToString());
            }

            if (mapData["customIcon"] != null)
            {
                script.Replace("document.customIcon = null", $"document.customIcon = '{mapData["customIcon"].ToString()}'");
                script.Replace("document.customIconAnchorX = null", $"document.customIconAnchorX = '{mapData["customIconAnchorX"].ToString()}'");
                script.Replace("document.customIconAnchorY = null", $"document.customIconAnchorY = '{mapData["customIconAnchorY"].ToString()}'");
            }

            if (mapData["heatmapGradient"] != null)
            {
                script.Replace("document.heatmapGradient = null;", $"document.heatmapGradient = {mapData["heatmapGradient"].ToString()};");
                script.Replace("document.heatmapRadius = 20", $"document.heatmapRadius = {mapData["heatmapRadius"].ToString()}");
            }

            return script.ToString();
        }

        private static int GetCacheKey(Hashtable mapData, int hashCode)
        {
            foreach (var key in mapData.Keys)
            {
                hashCode = (hashCode * 397) ^ key.GetHashCode();
                var value = mapData[key];
                if (value is Hashtable)
                {
                    hashCode = (hashCode * 397) ^ GetCacheKey(value as Hashtable, hashCode);
                }
                else if (value is List<Hashtable> && (value as List<Hashtable>).Count > 0)
                {
                    hashCode = (hashCode * 397) ^ GetCacheKey((value as List<Hashtable>)[0], hashCode);
                }
                else
                {
                    hashCode = (hashCode * 397) ^ value.ToString().GetHashCode();
                }
            }
            return hashCode;
        }
        #endregion
    }
